import React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';

const Add = () => {
    return (
        <div>
            <h1>Thêm sản phẩm</h1>
            <form action="">
                <label>Tên sản phẩm
                    <TextField name='name' label='Tên sản phẩm'/>
                </label><br/>
                <label>Giá(đ)
                    <input type="text" name='price' placeholder='Giá'/>
                </label>
                <label>Tồn kho
                    <input type="text" name='stock' placeholder='Tồn kho'/>
                </label><br/>
                <label>Mô tả
                    <input type="text" name='description' placeholder='Mô tả sản phẩm'/>
                </label>
                <Button variant='contained'>Thêm mới</Button>
                <Button variant="outlined">Hủy</Button>
            </form>
        </div>
    );
};

export default Add;
